contract GrayblockPool is BEP20{

    using SafeMath for uint256;
    address tokenA;
    address tokenB;
    uint public constant MINIMUM_LIQUIDITY = 10**3;

    uint256 public totalLiquidity;
    mapping (address => uint256) public liquidity;
    mapping (address => bool) public admins;

    address private LP_Cake = 0xc5b0d73A7c0E4eaF66baBf7eE16A2096447f7aD6;

    address WBNB = 0xbb4CdB9CBd36B01bD1cBaEBF2De08d9173bc095c;

    constructor ( address tokenA_address,address tokenB_address) BEP20("ProjectX", "GVM") public payable{
        tokenA=tokenA_address;
        tokenB=tokenB_address;
        admins[msg.sender]=true;
    }
    modifier onlyAdmin {    
        require(admins[msg.sender]==true, "Only admin can do that");
        _;
    }

function getAmountsOut(uint256 input_amount, address _tokenFrom,address _tokenTo) public view returns (uint256) {
    IBEP20 tokenFrom=IBEP20(_tokenFrom);
    IBEP20 tokenTo=IBEP20(_tokenTo);
    uint256 tokenA_reserve = tokenFrom.balanceOf(address(this));
    uint256 tokenB_reserve = tokenTo.balanceOf(address(this));
    return price(input_amount,tokenA_reserve,tokenB_reserve);

}

function price(uint256 input_amount, uint256 input_reserve, uint256 output_reserve) public pure returns (uint256) {
  uint256 input_amount_with_fee = input_amount.mul(997);
  uint256 numerator = input_amount_with_fee.mul(output_reserve);
  uint256 denominator = input_reserve.mul(1000).add(input_amount_with_fee);
  return numerator / denominator;
}
function swap(uint256 tokens,address _tokenFrom,address _tokenTo) public payable returns (uint256) {
  require(((_tokenFrom==tokenA)&&(_tokenTo==tokenB))||((_tokenFrom==tokenB)&&(_tokenTo==tokenA)),"wrong token or tokens");
IBEP20 tokenFrom=IBEP20(_tokenFrom);
IBEP20 tokenTo=IBEP20(_tokenTo);
safeTransferFrom(_tokenFrom,msg.sender,address(this),tokens);
uint256 token_reserve = tokenTo.balanceOf(address(this));
uint256 tokens_bought = price(tokens, tokenFrom.balanceOf(address(this)).sub(tokens), token_reserve);
safeTransferFrom(_tokenTo,address(this),msg.sender,tokens_bought);

  return tokens_bought;
}

function getRatio(uint256 tokensA,uint256 tokensB,uint MinimumA,uint MinimumB,uint token_reserveA,uint token_reserveB) public payable returns (uint amountA, uint amountB){


if (token_reserveA == 0 && token_reserveB == 0) {
      (amountA, amountB) = (tokensA, tokensB);
  } else {
      uint amountBOptimal = (tokensA.mul(token_reserveB)).div(token_reserveA);
      if (amountBOptimal <= tokensB) {
          require(amountBOptimal >= MinimumB, 'Grayblock: INSUFFICIENT_B_AMOUNT');
          (amountA, amountB) = (tokensA, amountBOptimal);
      } else {
          uint amountAOptimal = (tokensB.mul(token_reserveA)).div(token_reserveB);
          assert(amountAOptimal <= tokensA);
          require(amountAOptimal >= MinimumA, 'Grayblock: INSUFFICIENT_A_AMOUNT');
          (amountA, amountB) = (amountAOptimal, tokensB);
      }
  }
}
function depositLiquidity(uint256 tokensA,uint256 tokensB,uint MinimumA,uint MinimumB,address _tokenA,address _tokenB) public payable returns (uint amountA, uint amountB) {
require(((_tokenA==tokenA)&&(_tokenB==tokenB))||((_tokenA==tokenB)&&(_tokenB==tokenA)),"wrong token or tokens");
IBEP20 TokenA=IBEP20(_tokenA);
IBEP20 TokenB=IBEP20(_tokenB);
  uint256 token_reserveA = TokenA.balanceOf(address(this));
  uint256 token_reserveB = TokenB.balanceOf(address(this));

(amountA,amountB)=getRatio(tokensA,tokensB,MinimumA,MinimumB,token_reserveA,token_reserveB);
  safeTransferFrom(_tokenA,msg.sender,address(this),amountA);
  safeTransferFrom(_tokenB,msg.sender,address(this),amountB);
  uint liquidity_minted;
  if (totalSupply() == 0) {
      liquidity_minted = Math.sqrt(Math.min(amountA,amountB));
      _mint(msg.sender, liquidity_minted); // permanently lock the first MINIMUM_LIQUIDITY tokens
  } else {
      liquidity_minted = Math.min(amountA.mul(totalSupply()) / token_reserveA, amountB.mul(totalSupply()) / token_reserveB);
      _mint(msg.sender, liquidity_minted);
  }

}
function withdrawLiquidity(uint256 amount) public returns (uint256 amount0, uint256 amount1) {
require(balanceOf(msg.sender)>=amount,"POOL:The user did not provide that amount of liquidity");
safeTransferFrom(address(this),msg.sender,address(this),amount);
uint liquidityAmount=balanceOf(address(this));
uint balance0 = IBEP20(tokenA).balanceOf(address(this));
uint balance1 = IBEP20(tokenB).balanceOf(address(this));
amount0 = liquidityAmount.mul(balance0) / totalSupply(); // using balances ensures pro-rata distribution
amount1 = liquidityAmount.mul(balance1) / totalSupply(); // using balances ensures pro-rata distribution
_burn(address(this), liquidityAmount);
safeTransferFrom(tokenA,address(this),msg.sender,amount0);
safeTransferFrom(tokenB,address(this),msg.sender,amount1);
return (amount0, amount1);
}

    function safeTransfer(address _token, address to, uint value) internal {
        // bytes4(keccak256(bytes('transfer(address,uint256)')));
        (bool success, bytes memory data) = _token.call(abi.encodeWithSelector(0xa9059cbb, to, value));
        require(success && (data.length == 0 || abi.decode(data, (bool))), 'TransferHelper: TRANSFER_FAILED');
    }

    function safeTransferFrom(address _token, address from, address to, uint value) internal {
        // bytes4(keccak256(bytes('transferFrom(address,address,uint256)')));
        (bool success, bytes memory data) = _token.call(abi.encodeWithSelector(0x23b872dd, from, to, value));
        require(success && (data.length == 0 || abi.decode(data, (bool))), 'TransferHelper: TRANSFER_FROM_FAILED');
    }

}

